(1, 'حملة مجموعة أجياد التوعوية لمواجهة وباء جائحة كورونا – نشر الوعي مسئولية الجميع', 0, '<h3>&nbsp;جائحة كورونا مسؤلية الجميع</h3><p>في مايتعلق بموضوع جائحة كورونا لقد حاولنا جاهدين ك مجموعة اجياد على نشر الوعي وذلك ب اتباع الطرق التالية:</p><ul><li>غسل اليدين جيدا بالماء والصابون عند ملامسة اي معدن.</li><li>ارتداء &nbsp;الكمامة وعدم الاختلاط.</li><li>السعال او العطس داخل المنديل.</li><li>وضع المناديل المستعملة داخل سلة النفايات.</li></ul><figure class=\"image\"><img src=\"http://127.0.0.1:8000/media/post1-1_1693764787.png\"></figure>', 'http://127.0.0.1:8000/images/64f4d8b3481091693767859.png', 1, '2023-09-03 15:13:33', '2023-09-03 19:04:24');
