(32, 'فيزة عمل', '[{\"type\": \"counter\", \"steps\": [\"جواز السفر ساري المفعول فيزة عمل\", \"صورتين خلفية بيضاء 4×6\", \"الفحص الطبي من احدى المستشفيات المعتمدة\", \"صورة التأشيرة\", \"صورة هوية الكفيل للأفراد أو السجل التجاري للشركات\", \"عمل تفويض إلكتروني بإسم أجياد ترخيص رقم 17 فيزة عمل\"], \"title\": \"متطلبات الحصول على تأشيرة عمل في المملكة العربية السعودية فيزة عمل\"}, {\"type\": \"point\", \"steps\": [\"يجب الا تقل صلاحية الجواز عن ستة أشهر.\", \"مطابقة المهنة في الجواز للمهنه في فيزة العمل.\", \"إرفاق اصل شهادة المؤهل العلمي معمدة من الجهات الحكومية لفيز العمل المتخصصة\", \"لا يقل عمر المتقدم لنيل فيزة العمل عن 21 سنة ولا يزيد عن 40 سنة.فيزة عمل\", \"المستشفيات المعتمدة لعمل الفحص الطبي هي -مستشفى آزال صنعاء - عدن -مستشفى صابر عدن\"], \"title\": \"تعليمات اضافية فيزة عملل\"}, {\"type\": \"counter\", \"steps\": [\"الخطوة الاولى في سبيل الفيزة\"], \"title\": \"خطوة 3 لفيزة العمل\"}]', 'نستطيع تقديم خدمة الحصول على تأشيرة عمل في المملكة العربية السعودية\r\nوفي ما يلي الخطوات والمتطلبات والتعليمات للحصول على تأشيرة العمل', 1, '2023-09-03 20:07:18', '2023-09-03 20:07:18'),
